-- Algemeen:
function on.timer() -- deze function zal alle variabelen storen die in een invoervak zijn ingevuld
    
---------------INVOERVARIABELEN------------- --   
    if gevalPrint ~= 0 and copyPrint == 0 then                                             -- voor alle gevallen
    
    cursor.show()                                           -- toon cursor in de tekstbox
    
    lengte = tonumber(LengteLiggerBox:getExpression())                  -- haalt invoer uit box op en zet invoervariabele om in integer
    
        if gevalPrint == 1 or gevalPrint == 4 or gevalPrint == 5 then   -- voor gevallen 1,4 en 5
            
            puntLast = tonumber(LastBox:getExpression())                -- haalt invoer uit box op en zet invoervariabele om in integer
            
        end
        
        if gevalPrint == 2 or gevalPrint == 3 or gevalPrint == 6 or gevalPrint == 7 then -- voor gevallen 2,3,6 en 7
        
            verdeeldeLast = tonumber(LastBox:getExpression())           -- haalt invoer uit box op en zet invoervariabele om in integer
            
        end
        
        if gevalPrint == 1 or gevalPrint == 3 or gevalPrint == 4 or gevalPrint == 5 or gevalPrint == 7 then -- voor gevallen 1,3,4,5 en 7
        
            beginpunt = tonumber(BeginpuntLastBox:getExpression())      -- haalt invoer uit box op en zet invoervariabele om in integer
            
        end
        
        if gevalPrint == 3 or gevalPrint == 7 then                      -- voor gevallen 3 en 7
        
            eindpunt = tonumber(EindpuntLastBox:getExpression())        -- haalt invoer uit box op en zet invoervariabele om in integer
            
        end
         
        if gevalPrint == 4 then                                         -- voor geval 4
        
            verdeeldeLast = tonumber(EindpuntLastBox:getExpression())   -- haalt invoer uit box op en zet invoervariabele om in integer
            
        end
        
        
    end
    
        
    -- REACTIEKRACHTEN EN MOMENTEN --
    if copyPrint ~= 0 then -- enkel berekenen en grafiek tekenen wanneer er op de arrowUp knop wordt gedrukt, blijft staan bij het resetten van variabelen maar verdwijnt bij eht veranderen van geval
        
        --storen variabelen
        if puntLast then                                    -- als deze box is ingevuld zal deze variabele opgeslagen worden
            var.store("puntLast",puntLast)                  -- via var.store wordt de variable opgeslagen
        end
        
        if lengte then                                      -- als deze box is ingevuld zal deze variabele opgeslagen worden
            var.store("lengte",lengte)                      -- via var.store wordt de variable opgeslagen
        end
    
        if beginpunt then                                   -- als deze box is ingevuld zal deze variabele opgeslagen worden
            var.store("beginpunt",beginpunt)                -- via var.store wordt de variable opgeslagen
        end
        
        if verdeeldeLast then                               -- als deze box is ingevuld zal deze variabele opgeslagen worden
            var.store("verdeeldeLast",verdeeldeLast)        -- via var.store wordt de variable opgeslagen
        end
              
        if eindpunt then                                    -- als deze box is ingevuld zal deze variabele opgeslagen worden
            var.store("eindpunt",eindpunt)                  -- via var.store wordt de variable opgeslagen
        end
        
        if gevalPrint == 1 then -- geval 1
    
            if (puntLast and lengte and beginpunt) then -- enkel als alle 3 de variabelen zijn ingevuld in de invoerboxes
                   
            -- reactiekrachten en momenten berekenen; a = linkerinklemming ligger; b = rechterinklemming ligger
            ra = ((beginpunt*beginpunt*(lengte-beginpunt)-(beginpunt*((lengte-beginpunt)*(lengte-beginpunt)-(lengte*lengte)))-(lengte*lengte*lengte))*puntLast)/(lengte*lengte*lengte)
            rb = -(puntLast*beginpunt*((beginpunt*(lengte-beginpunt))-((lengte-beginpunt)*(lengte-beginpunt))+(lengte*lengte)))/(lengte*lengte*lengte)
            ma = (puntLast*beginpunt*(lengte-beginpunt)*(lengte-beginpunt))/(lengte*lengte)
            mb = (puntLast*beginpunt*beginpunt*(lengte-beginpunt))/(lengte*lengte)
            
            -- D - lijn
            d0 = 0               -- functie 1: 1e graad term
            d1 = - ra            -- functie 1: cte term
            l0 = 0               -- begingrens: functie 1
            l1 = beginpunt       -- eindgrens: functie 1
            
            d2 = 0               -- functie 2: 1e graad term
            d3 = rb              -- functie 2: cte term
            l2 = beginpunt       -- begingrens: functie 2
            l3 = lengte          -- eindgrens: functie 2
            
            beginligger = 0
            middenligger = beginpunt
            middenligger1 = beginpunt
            middenligger2 = beginpunt
            eindeligger = lengte
            krachtmid3 = -ra
            krachtmid4 = rb
            krachtmid1 = -ra
            krachtmid2 = rb
            
            -- M - lijn
            m0 = 0               -- functie 4: 2e graad term
            m1 = - ra              -- functie 4: 1e graad term
            m2 = - ma             -- functie 4: cte term
            i0 = 0               -- begingrens : functie 4  
            i1 = beginpunt       -- eindgrens : functie 4
            
            mxmax = beginpunt
            mymax = m1*mxmax+m2
            
            m3 = 0               -- functie 5: 2e graad term
            m4 = rb             -- functie 5: 1e graad term
            m5 = - mb - (rb*lengte)-- functie 5: cte term
            i2 = beginpunt       -- begingrens : functie 5
            i3 = lengte          -- eindgrens : functie 5
           
            
            end
            platform.window:invalidate() --refreshen van scherm
        elseif gevalPrint == 2 then -- geval 2
    
            if (verdeeldeLast and lengte) then -- enkel als alle 2 de variabelen zijn ingevuld in de invoerboxes
            
            -- reactiekrachten en momenten berekenen; a = linkerinklemming ligger; b = rechterinklemming ligger
            ra = - verdeeldeLast*lengte/2
            rb = - verdeeldeLast*lengte/2
            ma = (verdeeldeLast*lengte*lengte)/12
            mb = (verdeeldeLast*lengte*lengte)/12
            
            -- D - lijn
            d0 = - verdeeldeLast          -- functie 1: 1e graad term
            d1 = (verdeeldeLast*lengte/2) -- functie 1: cte term
            l0 = 0                        -- begingrens : functie 1
            l1 = lengte                   -- eindgrens : functie 1
            
            beginligger = 0
            middenligger = 0
            middenligger1 = 0
            middenligger2 = 0
            eindeligger = lengte
            krachtmid3 = 0
            krachtmid4 = 0
            krachtmid1 = 0
            krachtmid2 = 0
            
            -- M - lijn
            m0 = -verdeeldeLast/2           -- functie 4: 2e graad term
            m1 = verdeeldeLast*lengte/2   -- functie 4: 1e graad term
            m2 = -mb                        -- functie 4: cte term
            i0 = 0                         -- begingrens : functie 4
            i1 = lengte                    -- eindgrens : functie 4
            
            mxmax = lengte/2
            mymax = m0*mxmax*mxmax + m1*mxmax + m2
            
            end
            platform.window:invalidate() --refreshen van scherm
        elseif gevalPrint == 4 then -- geval 4
    
            if (puntLast and lengte and beginpunt and verdeeldeLast ) then -- enkel als alle 4 de variabelen zijn ingevuld in de invoerboxes
            
            -- reactiekrachten en momenten berekenen; a = linkerinklemming ligger; b = rechterinklemming ligger
            ra = ((beginpunt*beginpunt*(lengte-beginpunt)-(beginpunt*((lengte-beginpunt)*(lengte-beginpunt)-(lengte*lengte)))-(lengte*lengte*lengte))*puntLast)/(lengte*lengte*lengte)  - (verdeeldeLast*lengte)/2
            rb = -(puntLast*beginpunt*((beginpunt*(lengte-beginpunt))-((lengte-beginpunt)*(lengte-beginpunt))+(lengte*lengte)))/(lengte*lengte*lengte)   - (verdeeldeLast*lengte) /2
            ma = (puntLast*beginpunt*(lengte-beginpunt)*(lengte-beginpunt))/(lengte*lengte)   + (verdeeldeLast*lengte*lengte) /12
            mb = (puntLast*beginpunt*beginpunt*(lengte-beginpunt))/(lengte*lengte)   +     (verdeeldeLast*lengte*lengte) /12
            
            -- D - lijn
            d0 = - verdeeldeLast             -- functie 1: 1e graad term
            d1 = - ra                        -- functie 1: cte term
            l0 = 0                           -- begingrens: functie 1
            l1 = beginpunt                   -- eindgrens: functie 1
            
            d2 = - verdeeldeLast             -- functie 2: 1e graad term
            d3 = rb + (lengte*verdeeldeLast) -- functie 2: cte term
            l2 = beginpunt                   -- begingrens: functie 2
            l3 = lengte                      -- eindgrens: functie 2
            
            beginligger = 0
            middenligger = beginpunt
            middenligger1 = beginpunt
            middenligger2 = beginpunt
            eindeligger = lengte
            krachtmid3 = d1 + d0*beginpunt
            krachtmid4 = d1 + d0*beginpunt - puntLast
            krachtmid1 = d1 + d0*beginpunt
            krachtmid2 = d1 + d0*beginpunt - puntLast
            
            -- M - lijn
            m0 = - verdeeldeLast/2             -- functie 4: 2e graad term
            m1 = - ra                          -- functie 4: 1e graad term
            m2 = - ma                        -- functie 4: cte term
            i0 = 0                           -- begingrens : functie 4  
            i1 = beginpunt                   -- eindgrens : functie 4
                        
            m3 = - verdeeldeLast/2                             -- functie 5: 2e graad term
            m4 = -(- rb - 2*(verdeeldeLast*lengte/2))           -- functie 5: 1e graad term
            m5 = -(mb -(puntLast*beginpunt*((beginpunt*(lengte-beginpunt))-((lengte-beginpunt)*(lengte-beginpunt))+(lengte*lengte)))/(lengte*lengte))       -- functie 5: cte term
            i2 = beginpunt                                   -- begingrens : functie 5
            i3 = lengte                                      -- eindgrens : functie 5
            
            
            if (lengte-beginpunt) > beginpunt then
                
                mxmax = - m4/(2*m3)
                mymax = (4*m3*m5-(m4*m4))/(4*m3)
                print(mxmax)
                
            elseif (lengte-beginpunt) < beginpunt then
                
                mxmax = - m1/(2*m0)
                mymax = (4*m0*m2-(m1*m1))/(4*m0)
