            elseif (lengte-beginpunt) == beginpunt then
                mxmax = beginpunt
                mymax = m0*mxmax*mxmax + m1*mxmax + m2
                            
            end
            end
            platform.window:invalidate() --refreshen van scherm    
        elseif gevalPrint == 5 then -- geval 5
    
            if (puntLast  and lengte  and beginpunt ) then -- enkel als alle 3 de variabelen zijn ingevuld in de invoerboxes
            
            -- reactiekrachten en momenten berekenen; a = linkerinklemming ligger
            ra = -puntLast
            -- Rb = 0; enkele inklemming
            ma = puntLast*beginpunt
            -- Mb = 0;  enkele inklemming
            
            -- D - lijn
            d0 = 0                  -- functie 1: 1e graad
            d1 = - ra               -- functie 1: constante
            l0 = 0                  -- begingrens : functie 1
            l1 = beginpunt          -- eindgrens : functie 1
            
            d2 = 0                  -- functie 2: 1e graad
            d3 = 0                  -- functie 2: cte term
