---- ESCAPE KEY 6 GEVALLEN ----
-- Algemeen:
function on.escapeKey()
    
    if gevalPrint < 100 and copyPrint == 0 then
    
        ResetVariabelen()                         -- Reset alle sterkteleervariabelen
        changeBox = 0                             -- Reset programmeervariabele changeBox waarna je door de getFocus terug op het 1e invoervak terechtkomt
        on.resize(true)
        on.getFocus(true)                         -- roept terug de functie getFocus aan om terug in de beginbox te geraken
    
        LastBox:setExpression("")             -- elke invoerbox wordt geleegd, niet de variabele
        LengteLiggerBox:setExpression("")     -- elke invoerbox wordt geleegd, niet de variabele
        BeginpuntLastBox:setExpression("")    -- elke invoerbox wordt geleegd, niet de variabele
        EindpuntLastBox:setExpression("")     -- elke invoerbox wordt geleegd, niet de variabele
         
    end
    
    if gevalPrint < 100 and copyPrint ~= 0 then
         
         arrowUpVenster()
         
    end
    
    if gevalPrint > 100 then
        
        gevalPrint = gevalBezig
        gevalBezig = 0
        
    end
    
    platform.window:invalidate()              -- refreshen van scherm
    
end


---- TAB KEY 6 GEVALLEN ----
-- Algemeen:
function on.tabKey()
    
    changeBox = changeBox + 1                 -- per keer wanneer men op tab drukt zal deze variabele ++
    
    if (gevalPrint == 1 or gevalPrint == 5) then -- voor geval 1 en 5
    
        if changeBox > 2 then                 -- wanneer deze hoger dan het aantal boxes wil gaan terug naar 1e box gaan
            changeBox = 0                     -- changeBox variabele resetten
        end
        
        if changeBox == 0 then
            LastBox:setFocus(true)             -- cursor in deze box
            LengteLiggerBox:setFocus(false)    -- cursor niet in deze box
            BeginpuntLastBox:setFocus(false)   -- cursor niet in deze box
        elseif changeBox == 1 then
            LastBox:setFocus(false)            -- cursor niet in deze box
            LengteLiggerBox:setFocus(true)     -- cursor in deze box
            BeginpuntLastBox:setFocus(false)   -- cursor niet in deze box
        elseif changeBox == 2 then
            LastBox:setFocus(false)            -- cursor niet in deze box
            LengteLiggerBox:setFocus(false)    -- cursor niet in deze box
            BeginpuntLastBox:setFocus(true)    -- cursor in deze box
        end
        
    elseif (gevalPrint == 2 or gevalPrint == 6) then -- voor geval 2 en 6
       
        if changeBox > 1 then                  -- wanneer deze hoger dan het aantal boxes wil gaan terug naar 1e box gaan
            changeBox = 0                      -- changeBox variabele resetten
        end
        
        if changeBox == 0 then
            LastBox:setFocus(true)             -- cursor in deze box
            LengteLiggerBox:setFocus(false)    -- cursor niet in deze box
        elseif changeBox == 1 then
            LastBox:setFocus(false)            -- cursor niet in deze box
            LengteLiggerBox:setFocus(true)     -- cursor in deze box
        end
    
    elseif (gevalPrint == 3 or gevalPrint == 4 or gevalPrint == 7) then --  voor geval 3,4 en 7
        
        if changeBox > 3 then                  -- wanneer deze hoger dan het aantal boxes wil gaan terug naar 1e box gaan
            changeBox = 0                      -- changeBox variabele resetten
        end
        
        if changeBox == 0 then
            LastBox:setFocus(true)             -- cursor in deze box
            LengteLiggerBox:setFocus(false)    -- cursor niet in deze box
            BeginpuntLastBox:setFocus(false)   -- cursor niet in deze box
            EindpuntLastBox:setFocus(false)    -- cursor niet in deze box
        elseif changeBox == 1 then
            LastBox:setFocus(false)            -- cursor niet in deze box
            LengteLiggerBox:setFocus(true)     -- cursor in deze box
            BeginpuntLastBox:setFocus(false)   -- cursor niet in deze box
            EindpuntLastBox:setFocus(false)    -- cursor niet in deze box
        elseif changeBox == 2 then
            LastBox:setFocus(false)            -- cursor niet in deze box
            LengteLiggerBox:setFocus(false)    -- cursor niet in deze box
            BeginpuntLastBox:setFocus(true)    -- cursor in deze box
            EindpuntLastBox:setFocus(false)    -- cursor niet in deze box
        elseif changeBox == 3 then
            LastBox:setFocus(false)            -- cursor niet in deze box
            LengteLiggerBox:setFocus(false)    -- cursor niet in deze box
            BeginpuntLastBox:setFocus(false)   -- cursor niet in deze box
            EindpuntLastBox:setFocus(true)     -- cursor in deze box
        end
        
    end
    
    on.getFocus()                              -- getFocus oproepen zodat de cursor in de nieuwe box komt te staan
    platform.window:invalidate()               -- refreshen scherm
    
end 


---- ARROW UP 6 GEVALLEN ----
-- Algemeen:
function on.arrowUp()
    
        
    if (gevalPrint == 1 or gevalPrint == 5) then -- bij geval 1 en 5

        if (puntLast and lengte and beginpunt) then-- als al deze velden zijn ingevuld zal deze functie worden uitgevoerd
            
            if (beginpunt > lengte) then
    
                on.escapeKey(true)
                
            else
            
            if copyPrint == 0 then
            cursor.hide()
            arrowUpVenster()                       -- aanroepen wat de arrowUp methode moet doen voor deze gevallen indien alle tekstBoxes zijn ingevuld
            end
            end
            
        else
        
            on.tabKey()
            
        end
        
    elseif (gevalPrint == 2 or gevalPrint == 6) then -- bij geval 2 en 6
    
        if (verdeeldeLast and lengte) then           -- als al deze velden zijn ingevuld zal deze functie worden uitgevoerd
            
            if copyPrint == 0 then
            cursor.hide()
            arrowUpVenster()                       -- aanroepen wat de arrowUp methode moet doen voor deze gevallen indien alle tekstBoxes zijn ingevuld
            end
        else
        
            on.tabKey()
            
        end
    
    elseif gevalPrint == 3 or gevalPrint == 7 then -- bij geval 3 en 7
              
              if (verdeeldeLast and lengte and beginpunt and eindpunt) then -- als al deze velden zijn ingevuld zal deze functie worden uitgevoerd
                                
                    if (eindpunt > lengte) or (beginpunt > eindpunt) or (beginpunt > lengte) then
                    
                        on.escapeKey(true)
                    
                    else
                    
                        if copyPrint == 0 then
                        cursor.hide()
                        arrowUpVenster()                       -- aanroepen wat de arrowUp methode moet doen voor deze gevallen indien alle tekstBoxes zijn ingevuld
                        end
                    end
                    
                   
              else
        
                  on.tabKey()
            
              end
               
    elseif gevalPrint == 4 then -- bij geval 4
            
                if (puntLast and lengte and beginpunt and verdeeldeLast) then -- als al deze velden zijn ingevuld zal deze functie worden uitgevoerd
            
                    if (beginpunt > lengte) then
    
                        on.escapeKey(true)
                
                    else
            
                        if copyPrint == 0 then
                        cursor.hide()
                        arrowUpVenster()                       -- aanroepen wat de arrowUp methode moet doen voor deze gevallen indien alle tekstBoxes zijn ingevuld
                        end
                    end
                    
                 else
        
                     on.tabKey()
            
                 end
                   
    end
    
    platform.window:invalidate()               -- refreshen scherm
    
end



------ SCHERM ------
-- Algemeen:
function on.paint(gc)                            -- verschijnt op display

    local h = platform.window:height()           -- definieren hoogte scherm
    local w = platform.window:width()            -- definieren breedte scherm
    local sc = 0                                 -- definieren schaalfactor
    
        --achtergrondkleur
        gc:setColorRGB(255,255,255)
        gc:fillRect(0,0,w,h)
        
        --achtergrondrechtoek onderaan
        gc:setColorRGB(0,136,136)
        gc:fillRect(0,h/1.15,w,h/1.5)
        
    if gevalPrint < 100 then
    
    if gevalPrint == 0 then                         -- startscherm, niet voor een geval
        
        local imw = VitruBeam:width()
        local imh = VitruBeam:height()
        local sf = math.max(imw/(w/1.5), imh/(h/2))    -- schaalfactor bepalen
        local im = VitruBeam:copy(imw/sf, imh/sf)    -- op schaal brengen
        local imw = im:width(im)
        local imh = im:height(im)
        gc:drawImage(im,(w-imw)/1.2,imh/1.7)
        
        local str1 = "Druk op 'menu' om te starten" -- String 1
        local str3 = "© Vitruvius"                  -- String 3
        
        gc:setColorRGB(0,0,0)                    -- kleur instellen
        gc:setFont("serif","r",h/22)             -- fontinstellingen
        local sw = gc:getStringWidth(str1)       -- Stringbreedte
        local sh = gc:getStringHeight(str1)      -- Stringhoogte
        gc:drawString( str1, w/40, h/1.03) -- String op diplay plaatsen

        gc:setColorRGB(255,255,255)
        gc:setFont("serif","i",h/18)
