function arrowUpVenster()

    if gevalPrint ~= 0 then                        -- als de display niet op het hoofdscherm staat maar op een geval
    
        if copyPrint == 0 then                     -- als je voor de 1x op de pijl omhoog drukt dan verschijnen de berekeningen
        
            copyPrint = gevalPrint                 -- deze variabele wordt verschillend van 0
                   
            -- tekstboxes
            cursor.hide()
            
            LengteLiggerBox:setReadOnly(true)
            LastBox:setReadOnly(true)
            BeginpuntLastBox:setReadOnly(true)
            EindpuntLastBox:setReadOnly(true)
            
            LastBox:setVisible(false)              -- Tekstbox false/true = onzichtbaar/zichtbaar
            LengteLiggerBox:setVisible(false)      -- Tekstbox false/true = onzichtbaar/zichtbaar
            BeginpuntLastBox:setVisible(false)     -- Tekstbox false/true = onzichtbaar/zichtbaar
            EindpuntLastBox:setVisible(false)      -- Tekstbox false/true = onzichtbaar/zichtbaar
                        
        elseif copyPrint ~= 0 then                 -- als je voor de 2x op de pijl omhoog drukt keer je terug naar je invoervelden
            
            ResetVariabelen()
            
            LengteLiggerBox:setReadOnly(false)
            LastBox:setReadOnly(false)
            BeginpuntLastBox:setReadOnly(false)
            EindpuntLastBox:setReadOnly(false)
            
            platform.window:invalidate()                   -- scherm refreshen
            
            cursor.show()
            copyPrint = 0                          -- copyPrint terug op 0 zetten zodat bij een volgende aanroep het andere IF-statement wordt aangeroepen
                        
        end
    
    end
    
    platform.window:invalidate()                   -- scherm refreshen
    
end